from django.db import modelsclass Subway(models.Model):    stationName = models.CharField(max_length=30)    lat = models.IntegerField()    lng = models.IntegerField()    hosun = models.CharField(max_length=15)    def __str__(self):        return f"stationName={self.stationName}, lat={self.lat}, lng={self.lng}, hosun={self.hosun}"class Cultureplace(models.Model):    group = models.CharField(max_length=10)    placeName = models.CharField(max_length=50)    lineNumber = models.CharField(max_length=15)    station = models.CharField(max_length=15)    address = models.CharField(max_length=50)    lat = models.IntegerField()    lng = models.IntegerField()    def __str__(self):        return f"group={self.group}, placename={self.placeName}, linenumber={self.lineNumber}, station={self.station}, lat={self.lat}, lng={self.lng}"